    def saveAddTestAnswerKey(self):
        # instance of Ui_AnswerKey dialog box
        self.window = QtWidgets.QDialog()
        self.ui = Ui_AnswerKey()
        self.ui.setupUi(self.window)
        self.window.show()
        QtCore.QTimer.singleShot(4000, self.window.close)
        self.saveAnsKeyBtn.setEnabled(False)
        self.AnsKeyTbl.setEditTriggers(
            QtWidgets.QAbstractItemView.NoEditTriggers)
        self.saveAnsKeyBtn.setStyleSheet("color: rgb(138, 138, 138);\n"
                                         "background-color: #cccccc;\n"
                                         "font: 12pt \"Arial\";")
        self.changeAnswerKeyBtn.setEnabled(True)

        #loop values in table  
        rowCount=self.AnsKeyTbl.rowCount();
        columnCount=self.AnsKeyTbl.columnCount();
        rowData=[]
        for row in range(rowCount):
            for column in range(columnCount):
                widgetItem=self.AnsKeyTbl.item(row,column)
                if(widgetItem and widgetItem.text):
                    rowData.append(widgetItem.text())
                else:
                    rowData.append('NULL')
        self.file_save(rowData)

    #writes in txt file
    def file_save(self, rowData):
        f = open('answerkey.txt', 'w')
        for data in rowData:
            f.write(str(data)+'\n')
        f.close()

    def changeAnswerKey(self):
        self.saveAnsKeyBtn.setEnabled(True)
        self.changeAnswerKeyBtn.setEnabled(False)
        self.saveAnsKeyBtn.setStyleSheet("color: rgb(255, 255, 255);\n"
                                         "background-color: rgb(69, 207, 101);\n"
                                         "font: 12pt \"Arial\";")
        self.AnsKeyTbl.setEditTriggers(QtWidgets.QAbstractItemView.AnyKeyPressed|QtWidgets.QAbstractItemView.CurrentChanged)
        self.AnsKeyTbl.clearContents()
        if os.path.exists("answerkey.txt"):
            os.remove("answerkey.txt")
        else:
            self.file_save()

